// Estilo para cada feature del GeoJSON
function styleLoteos(feature) {
  var color;
  if (feature.properties.Estado_documental === 'Loteo con trámite  Iniciado') {
    color = '#ff1201';
  } else if (feature.properties.Estado_documental === 'Loteo con trámite Avanzado') {
    color = '#ff8201';
  } else if (feature.properties.Estado_documental === 'Loteo Visado por el Municipio') {
    color = '#fff201';
  } else if (feature.properties.Estado_documental === 'Loteo Aprobado') {
    color = '#a3de3c';
  } else {
    color = '#ccc'; // Color por defecto si no coincide ninguna categoría
  }
  return {
    weight: 0.6,
    opacity: 0.7,
    fillColor: color,
    color: "#000",
    dashArray: '0',
    fillOpacity: 0.9,
  };
}


// funcion popous 
function onEachFeature(feature, layer) {
  if (feature.properties && feature.properties.popupContent) {
    layer.bindPopup(feature.properties.popupContent);
  }
}
